import React from 'react';
import './MovieComponent.css'

function Movie ( { id, title, image, rating} ) {

  const trueRating = Math.rating * 10

  return (
    <div className='indivMovie' >
      <img src={`https://image.tmdb.org/t/p/w500${image}`} height='500px' width='350px' alt="Italian Trulli"/>
     <div className='movieInfo'>
     {title}
     {trueRating}
      </div> 
    </div> 
  );
}

export default Movie;
